<script setup>
import { computed, reactive, ref, toRefs } from 'vue';

const props = defineProps({
  winner: {
    type: String,
  }
})

const { winner } = toRefs(props)
const imgPosition = computed(() => {
  if (winner.value) {
    if (winner.value === "Player") {
      return reactive({
        left: `-138px`
      })
    }
    if (winner.value === "Banker") {
      return reactive({
        left: `-18px`
      })
    }
    if (winner.value === "Tie") {
      return reactive({
        left: `-258px`
      })
    }
  }

})
</script>

<template>
  <div class="winner-text">
    <div class="num-block">
      <img :style="imgPosition"
        src="data:image/png;base64,">
    </div>
  </div>
</template>

<style scoped lang="less">
.winner-text {
  padding-top: 12px;
  height: 130px;
  overflow: hidden;

  .num-block {
    position: relative;
    width: 82px;
    height: 120px;
    overflow: hidden;

    img {
      height: 100%;
      position: absolute;
      top: 0;
      left: 0;
    }
  }
}
</style>
